// src/Chat.js
import React, { useState, useEffect } from "react";
import axios from "./axiosConfig"; // 인터셉터 설정 시
import { useNavigate } from "react-router-dom";

function Chat() {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState("");
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  // 사용자 인증 확인
  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login");
    } else {
      fetchConversationHistory();
    }
    // eslint-disable-next-line
  }, []);

  // 대화내역 불러오기
  const fetchConversationHistory = async () => {
    try {
      const res = await axios.get("/conversation/history");
      const conversations = res.data;
      if (conversations.length > 0) {
        // 가장 최근 대화 선택
        setMessages(conversations[0].messages);
      }
    } catch (err) {
      console.error("대화내역 불러오기 오류:", err);
    }
  };

  const sendMessage = async () => {
    if (input.trim() === "") return;

    console.log("sendMessage 호출됨");

    // 사용자 메시지 추가
    const newMessages = [...messages, { sender: "user", text: input }];
    setMessages(newMessages);
    setLoading(true);

    try {
      console.log(`React: 백엔드로 메시지 전송: ${input}`);
      // 백엔드로 메시지 전송
      const response = await axios.post("/chat", { message: input });
      const botMessage = response.data.response;
      console.log(`React: 백엔드로부터 응답 받음: ${botMessage}`);

      // 챗봇 응답 추가
      setMessages([...newMessages, { sender: "bot", text: botMessage }]);

      // 대화내역 저장
      await axios.post("/conversation/save", {
        messages: [...newMessages, { sender: "bot", text: botMessage }],
      });
    } catch (error) {
      console.error("Error sending message:", error);
      setMessages([
        ...newMessages,
        { sender: "bot", text: "죄송합니다. 오류가 발생했습니다." },
      ]);
    }

    setLoading(false);
    setInput("");
  };

  const handleKeyPress = (e) => {
    if (e.key === "Enter") {
      sendMessage();
    }
  };

  // 로그아웃 기능 추가 (선택 사항)
  const logout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  return (
    <div style={styles.container}>
      <div style={styles.header}>
        <h2>챗봇</h2>
        <button onClick={logout} style={styles.logoutButton}>
          로그아웃
        </button>
      </div>
      <div style={styles.chatBox}>
        {messages.map((msg, index) => (
          <div
            key={index}
            style={
              msg.sender === "user" ? styles.userMessage : styles.botMessage
            }
          >
            <strong>{msg.sender === "user" ? "사용자" : "챗봇"}:</strong>{" "}
            {msg.text}
          </div>
        ))}
        {loading && (
          <div style={styles.botMessage}>
            <strong>챗봇:</strong> 응답 중...
          </div>
        )}
      </div>
      <div style={styles.inputArea}>
        <input
          type="text"
          value={input}
          onChange={(e) => setInput(e.target.value)}
          onKeyPress={handleKeyPress}
          style={styles.input}
          placeholder="메시지를 입력하세요..."
        />
        <button onClick={sendMessage} style={styles.button}>
          전송
        </button>
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: "flex",
    flexDirection: "column",
    height: "100vh",
    maxWidth: "600px",
    margin: "0 auto",
    padding: "20px",
    boxSizing: "border-box",
  },
  header: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    marginBottom: "10px",
  },
  logoutButton: {
    padding: "5px 10px",
    fontSize: "14px",
    backgroundColor: "#dc3545",
    color: "#fff",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
  },
  chatBox: {
    flex: 1,
    overflowY: "auto",
    marginBottom: "20px",
    padding: "10px",
    border: "1px solid #ccc",
    borderRadius: "5px",
  },
  userMessage: {
    textAlign: "right",
    margin: "10px 0",
    padding: "10px",
    backgroundColor: "#DCF8C6",
    borderRadius: "10px",
    display: "inline-block",
  },
  botMessage: {
    textAlign: "left",
    margin: "10px 0",
    padding: "10px",
    backgroundColor: "#FFF",
    borderRadius: "10px",
    display: "inline-block",
  },
  inputArea: {
    display: "flex",
  },
  input: {
    flex: 1,
    padding: "10px",
    fontSize: "16px",
    borderRadius: "5px",
    border: "1px solid #ccc",
    marginRight: "10px",
  },
  button: {
    padding: "10px 20px",
    fontSize: "16px",
    borderRadius: "5px",
    border: "none",
    backgroundColor: "#28a745",
    color: "#fff",
    cursor: "pointer",
  },
};

export default Chat;
